import React from "react";
import styles from "./SearchBar.module.css";

function SearchBar(){

    function onClickk(e){
        if(e.target.value === "Search pokemon..."){
            e.target.value = "";
        }
    }

    return (
        <div className="container">
            <input onClick={(e)=>onClickk(e)} type="text" defaultValue="Search pokemon..."></input>
        </div>
    )
}

export default SearchBar;
